If we were required to draw upon our line of credit, indebtedness could adversely affect our ability to operate our business, financial condition and results of operations.
We have $25.0 million available for borrowing under our revolving line of credit with Western Alliance Bank, and in the future we could incur indebtedness beyond our revolving line of credit.
Borrowing under our revolving line of credit or otherwise, combined with our other financial obligations and contractual commitments, could have significant adverse consequences, including:
•requiring us to dedicate a portion of our cash resources to the payment of interest and principal, reducing money available to fund working capital, capital expenditures, product development and other general corporate purposes;
•increasing our vulnerability to adverse changes in general economic, industry and market conditions; •subjecting us to restrictive covenants that may reduce our ability to take certain corporate actions or obtain further debt or equity financing (for example, the covenants in the loan and security agreement for our revolving line of credit include limitations on our ability to incur additional indebtedness and engage in certain fundamental business transactions, such as mergers or acquisitions of other businesses);

•price and volume fluctuations in the overall stock market from time to time;
•volatility in the market price and trading volume of comparable companies;
•actual or anticipated changes in our earnings or fluctuations in our operating results or in the expectations of securities analysts;
•announcements of new service offerings, strategic alliances or significant agreements by us or by our competitors;
•loss of key personnel;
•litigation involving us or that may be perceived as having an adverse effect on our business;
•changes in general economic, industry and market conditions and trends;
•investors’ general perception of us;
•sales of large blocks of our stock; and
•announcements regarding industry consolidation. In addition, equity markets in general, and the equities of technology companies in particular, have experienced and may experience in the future, extreme price and volume fluctuations due to, among other factors, the actions of market participants or other actions outside of our control. Such price and volume fluctuations may adversely affect the market price of our common stock for reasons unrelated to our business or operating results.

•a majority of the board of directors consist of independent directors;
•director nominees be selected or recommended for the board’s selection by independent directors constituting a majority of the independent directors or by a nominations committee with prescribed duties and a written charter and comprised solely of independent directors; and
•the board of directors maintain a compensation committee with prescribed duties and a written charter and comprised solely of independent directors. We have availed ourselves of certain of these exemptions and, for so long as we qualify as a “controlled company,” we will maintain the option to utilize from time to time some or all of these exemptions. For example, we do not have a nominations committee, and director nominees might not be selected or recommended for the board’s selection by a qualifying nominations committee or by independent directors constituting a majority of the independent directors, and our compensation committee is not comprised solely of independent directors. Accordingly, should the interests of Link Ventures differ from those of other stockholders, the other stockholders may not have the same protections afforded to stockholders of companies that are subject to all of the Nasdaq Stock Market corporate governance standards. Our status as a controlled company could make our Class A common stock less attractive to some investors or otherwise harm our stock price.

•providing that directors may be removed by stockholders only for cause and only with a vote of the holders of shares representing a majority of the voting power of all shares that stockholders would be entitled to vote for the election of directors;
•limiting the ability of our stockholders to call and bring business before special meetings of stockholders and to take action by written consent in lieu of a meeting;
•requiring advance notice of stockholder proposals for business to be conducted at meetings of our stockholders and for nominations of candidates for election to our board of directors;
•authorizing blank check preferred stock, which could be issued with voting, liquidation, dividend and other rights superior to our Class A common stock; and
•limiting the liability of, and providing indemnification to, our directors and officers. As a Delaware corporation, we are also subject to provisions of Delaware law, including Section 203 of the Delaware General Corporation Law, which limits the ability of stockholders holding shares representing more than 15% of the voting power of our outstanding voting stock from engaging in certain business combinations with us, unless the interested stockholder attained such status with the approval of our board of directors or unless the business combination is approved in a prescribed manner. Any provision of our restated certificate of incorporation or amended and restated bylaws or Delaware law that has the effect of delaying or deterring a change in control could limit the opportunity for our stockholders to receive a premium for their shares of our Class A common stock, and could also affect the price that some investors are willing to pay for our Class A common stock.
